DROP TABLE IF EXISTS `hunuo_users`;
CREATE TABLE `hunuo_users`  (
  `user_id` mediumint(8) UNSIGNED NOT NULL AUTO_INCREMENT,
  `aite_id` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `email` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '',
  `user_name` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '',
  `password` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '',
  `is_surplus_open` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否开启余额支付密码功能',
  `surplus_password` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '余额支付密码',
  `question` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '',
  `answer` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '',
  `sex` tinyint(1) UNSIGNED NOT NULL DEFAULT 0,
  `birthday` date NOT NULL DEFAULT '0000-00-00',
  `user_money` decimal(10, 2) NOT NULL DEFAULT 0.00,
  `frozen_money` decimal(10, 2) NOT NULL DEFAULT 0.00,
  `pay_points` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '要保留小数点后一位',
  `rank_points` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '要保留小数点后一位',
  `address_id` mediumint(8) UNSIGNED NOT NULL DEFAULT 0,
  `reg_time` int(10) UNSIGNED NOT NULL DEFAULT 0,
  `last_login` int(11) UNSIGNED NOT NULL DEFAULT 0,
  `last_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `last_ip` varchar(15) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '',
  `visit_count` smallint(5) UNSIGNED NOT NULL DEFAULT 0,
  `user_rank` tinyint(3) UNSIGNED NOT NULL DEFAULT 0,
  `is_special` tinyint(3) UNSIGNED NOT NULL DEFAULT 0,
  `ec_salt` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `salt` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0',
  `parent_id` mediumint(9) NOT NULL DEFAULT 0,
  `flag` tinyint(3) UNSIGNED NOT NULL DEFAULT 0,
  `alias` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `msn` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `qq` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `office_phone` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `home_phone` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `mobile_phone` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `is_validated` tinyint(3) UNSIGNED NOT NULL DEFAULT 0,
  `validated` int(11) NOT NULL,
  `credit_line` decimal(10, 2) UNSIGNED NOT NULL,
  `passwd_question` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `passwd_answer` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `is_fenxiao` tinyint(1) NOT NULL,
  `real_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `card` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `face_card` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `back_card` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `country` int(11) NOT NULL,
  `province` int(11) NOT NULL,
  `city` int(11) NOT NULL,
  `district` int(11) NOT NULL,
  `address` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `status` int(11) NOT NULL,
  `mediaUID` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `mediaID` int(4) NOT NULL,
  `froms` char(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT 'pc' COMMENT 'pc:电脑,mobile:手机,app:应用',
  `headimg` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `is_agent` tinyint(3) NOT NULL DEFAULT 0 COMMENT '0非业主 1业主',
  `agent_code` varchar(60) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '业主编号',
  `shop_id` mediumint(8) UNSIGNED NOT NULL DEFAULT 0 COMMENT '所属店铺ID',
  `agent_type` tinyint(3) NOT NULL DEFAULT 0 COMMENT '1小盘 2中盘 3大盘 4VIP',
  `pid1` int(11) NOT NULL DEFAULT 0 COMMENT '上1级业主id',
  `pid2` int(11) NOT NULL DEFAULT 0 COMMENT '上2级业主id',
  `pid3` int(11) NOT NULL DEFAULT 0 COMMENT '上3级业主id',
  `stock_right` int(11) NOT NULL DEFAULT 0 COMMENT '用户期权',
  PRIMARY KEY (`user_id`) USING BTREE,
  UNIQUE INDEX `user_name`(`user_name`) USING BTREE,
  INDEX `email`(`email`) USING BTREE,
  INDEX `parent_id`(`parent_id`) USING BTREE,
  INDEX `flag`(`flag`) USING BTREE,
  INDEX `mediaUID`(`mediaUID`, `mediaID`) USING BTREE
) ENGINE = MyISAM AUTO_INCREMENT = 1425 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

